(36934, '6FC87FE6-CEEC-4C7B-9168-91BFF4B1DA4B', '￼We are doing some media and storytelling work. I️ was thinking about how this also applies to us and when we say how we are feeling, it allows us to connect, instead of making arguments. ', 'Nitzan', 'David', '2021-11-04T11:01:11.117273'),
