(36948, '37ACA5C1-11B0-4D3C-8D7A-7207301B4938', 'Ah love. Was so strange last night not having you in bed next to me. Was the first time i really felt restless not having you to hold on to or have some limb making contact. Wanted so much to be pressed into you. ', 'David', 'Nitzan', '2021-11-04T14:17:57.164949'),
