(36950, 'D266CA67-DFA2-4DD0-9250-28D9F041913C', 'Beth also called me this afternoon and was so upset because Jonathan is so cold and it’s making everything so hard.', 'Nitzan', 'David', '2021-11-04T15:02:15.498565'),
(36951, '8AD997A4-938C-4B24-9F78-455B47FDECA6', 'And I️ think about the convo we had two nights ago and how you said “we’ll ultimately, I️ invested because I️ want to be with Nitzan.” I️’m so touched by you and that. And that I️ have someone who is so warm and so loving and reinvests in our spark every day. I️ hit the lottery when I️ met you. I️ knew it then and I️ feel that more every day. ', 'Nitzan', 'David', '2021-11-04T15:03:43.597302'),
(36952, '4ECF4AEB-31EE-48D4-8229-5FB2B76F5088', 'And thank you for giving me the space to refuel with the oxygen of my Aspen fellows. It’s been an incredible few days and the experience is unparalleled. ', 'Nitzan', 'David', '2021-11-04T15:04:32.249519'),
